import { BlockList } from 'net';
import React, { useEffect, useState } from 'react'
import { View, Text, StyleSheet, TouchableWithoutFeedback, Button, TextInput,TouchableOpacity } from 'react-native';


export default function Chat({ socket, username, room }) {
    const [usertwo, setUserTwo] = useState("");
    const [currentMessage, setCurrentMessage] = useState("");
    const [messageList, setMessageList] = useState([]);
    const[boxes,setBoxes]=useState(
        [{"name":"", "value":"" },{"name":"", "value":""},{"name":"", "value":"" },
         {"name":"", "value":"" },{"name":"", "value":"" },{"name":"", "value":"" },
         {"name":"", "value":"" },{"name":"", "value":"" },{"name":"", "value":"" }]);
    const[winner, setWinner] =useState(null);
    const sendMessage = async () => {
        if (currentMessage !== "") {
            const messageData = {
                room: room,
                author: username,
                message: currentMessage,
                time: new Date(Date.now()).getHours() +
                    ":" +
                    new Date(Date.now()).getMinutes(),
                tic_tac_list:boxes
            };
            // if(author=== username){

            // }
            await socket.emit("send_message", messageData);
            setMessageList((list) => [...list, messageData])
            setCurrentMessage("");
        }
    };
    const winPosition =[
        [0,1,2], [3,4,5], [6,7,8],
        [0,3,6], [1,4,7], [2,5,8],
        [0,4,8], [2,4,6],
      ]
    const handleClick = ((index,messageContent) => {
        const boxValue = [...boxes]
       console.log("boxValue", boxValue);
        const obj = boxValue[index]
        console.log("obj", obj);
        
        boxValue[index].value="X"
       
        const tictacdata = {
            room: room,
            author: username,
            //message: currentMessage,
            time: new Date(Date.now()).getHours() +
                ":" +
                new Date(Date.now()).getMinutes(),
            tic_tac_list:boxValue,
            position:index
        };
        socket.emit("send_tictactoe", tictacdata); 
        const boxValue2 = [...boxes]
        // console.log("boxValue", boxValue);
        //  const obj2 = boxValue2[index]
        //  console.log("obj", obj2);
        boxValue2[index].value="O"
         setBoxes(boxValue2);
        
    })
    useEffect(() => {
        
        socket.on("recived_tictoc", (data) => {
            console.log("Data",data);
            const boxValue2 = [...boxes]
            boxValue2[data.position].value="X"
            setBoxes(boxValue2);
            
             //console.log("boxValue", boxValue);
            //const obj = boxValue[index]
          //  console.log("obj", obj);
        
            // username === messageContent.author ? 
            // boxValue[index].value="O"
            // : 
            // boxValue[index].value="X"
            //  setUserTwo(data["author"]);
            // // const userTwos =data["author"];
           
            // console.log("Data=>", data["author"]);
            // setMessageList((list) => [...list, data])
        })
        
        console.log("user",username);
        //console.log("usertwo",usertwo);
    }, [socket])
    
    return (
        <View style={styles.mainContainer}>
            <View style={styles.container}>
            <Text style={styles.useNameText}>{username}</Text>
            <View style={{ flexDirection: "row", flexWrap: "wrap" }}>
                {
                    boxes.map((s1, index) => <View style={{ flexBasis: "30%", borderRadius: 3, backgroundColor: "yellow", borderWidth: 3, padding: 25, textAlign: "center" }} key={index}>
                        <TouchableOpacity style={{
                            height: 100,
                            padding: 20,
                        }}
                            onPress={() => handleClick(index,s1)}
                        >
                            {s1.value}
                        </TouchableOpacity>

                    </View>)
                }


            </View>
         
                {/* <View style={styles.chatheader}>
                    <Text style={styles.useNameText}>{username}</Text>
                    <Text style={styles.headerText}>Join A Chat</Text>

                </View>
                <View style={styles.chatbody}>
                    {
                        messageList.map((messageContent) =>
                            <View style={styles.message} id={username === messageContent.author ? "you" : "other"}>

                                <View>
                                    <View style={styles.messageContent}>
                                        <View>{messageContent.message}</View>
                                    </View>
                                    <View style={styles.messageMeta}>
                                        <View>{messageContent.time}</View>
                                        <View>{messageContent.author}</View>
                                    </View>
                                </View>

                            </View>)
                    }


                </View>
                <View style={styles.chatfooter}>
                    <TextInput
                        style={styles.textInput}
                        placeholder='Write Down Message...'
                        onChangeText={setCurrentMessage}
                        value={currentMessage}
                        onKeyPress={(event) => {
                            event.key === "Enter" && sendMessage();
                        }}

                    />
                    <Button
                        styles={styles.buttonTab}
                        onPress={sendMessage}
                        title='Send'
                    />
                </View> */}


            </View>

        </View>

    )
}


const styles = StyleSheet.create({
    mainContainer: {
        flex: 1,
        marginTop: 200,
        borderWidth: 3,
        marginBottom: 10,
        marginRight: 120,
        marginLeft: 120,
        alignItems: 'center',
        justifyContent: 'center',
    },

    chatheader: {

        alignItems: "center",
        fontSize: 20,
    },
    chatbody: {
        marginLeft: 30,
        marginRight: 30,
        height: (450 - (70 + 70)),
        width: 450,
        border: 2,
        backgroundColor: "lemonchiffon",

        position: "relative",
    },
    chatfooter: {
        marginLeft: 30,
        marginRight: 30,
        // height: (450 - (70 + 70)),
        width: 450,
        border: 2,
        backgroundColor: "white",
        position: "relative",
    },
    useNameText: {
        color: "red",
        fontSize: 40,
    },
    textInput: {
        //backgroundColor:"green",
        padding: 4,
        borderColor: "black",
        borderWidth: 2,
        marginBottom: 3
    },
    buttonTab: {
        marginBottom: 10,
        width: 400,
    },
    container: {
        flex: 1,
        marginTop: 15,
        marginBottom: 50,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    headerText: {
        fontSize: 40,
        fontWeight: "bold"
    },
    messageContent: {
        color: "black",
        fontSize: 25,
        marginRight: 20,
        marginLeft: 20,
    },
    messageMeta: {
        color: "black",
        marginRight: 20,
        marginLeft: 20,
    }
})
